<script type="text/javascript">
$(document).ready(function() {
	PRQ.params = CU.parseUrlParams(window.location+"");
	
	var token = PRQ.get("token");
	var type = PRQ.get("type");
	
	
	if(!CU.isEmpty(token)) {
		PU.verifyToken(token);
	}
	if(CU.isEmpty(type)) {
		type = "normal";
	}
	
	var url = "./tannux/spa/tannux-spa-"+type+".html";
	window.location = url;
});
</script>
